const Button = ({ name, isLoggedIn }) => {
    return isLoggedIn ? null : <button>{name}</button> 
  };
  
  const Login = () => {
    return (
      <>
        <Button isLoggedIn={false} name="Login" />
        <Button isLoggedIn={true} name="Logout" />
      </>
    );
  };
  
  export default Login;
